package com.eling.elcms.assistant.api.service.protocol.impl;

import java.util.Date;

import org.apache.commons.lang3.ObjectUtils;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.stereotype.Service;

import com.eling.elcms.assistant.api.model.AssistantMessage;
import com.eling.elcms.assistant.api.service.AssistantSender;
import com.eling.elcms.assistant.api.service.IAssistantMessageManager;
import com.eling.elcms.assistant.api.service.IProtocolCommand;
import com.eling.elcms.assistant.api.util.Contants;

/**
 * 语音标签(做多可播放20k,15S左右)
 * 
 * @author swq
 *
 */
@Service
@SuppressWarnings("unused")
public class VoiceLabelProtocolCommandImpl  implements IProtocolCommand{
	
	@Override
	public String getProtocol() {
		return "IWAP09";
	}
	private static String labelVoice = ObjectUtils.CONST("");

	@Autowired
	private IAssistantMessageManager assistantmessageManager;

	@Autowired
	private AssistantSender assistantSender;
	
	public String process(String para, String imei) {

		String[] paras = para.split(",");
		// TODO 取得天气预报语音
		
		AssistantMessage message = new AssistantMessage();
		message.setImei(imei);
		message.setProtocol(Contants.VOICE_LABEL_DOWN);
		message.setVoice(labelVoice);
		message.setCreateDate(new Date());
		message = assistantmessageManager.save(message);

		// 尚未下发的语音数量
		int voiceNum = 1;
		if(voiceNum>0){
			//有天气信息则下发
			String voice = message.getVoice();
			// 下发第一个语音包
			// 总分包数
			int allPackage = voice.length() / 1024 + (voice.length() % 1024 != 0 ? 1 : 0);
			// 从第一个开始下发
			int size = allPackage > 1 ? 1024 : voice.length();
			String passPara = Contants.VOICE_LABEL_DOWN + ",D3590D54," + message.getPkAssistantMessage() + "," + allPackage
					+ ",1," + size + ",";
			String savePara = passPara + "...";
			String result = assistantSender.callApi(passPara + voice.substring(0, size), imei);
		}
		
		String result = Contants.VOICE_LABEL_RETURN + "," + voiceNum;
		return result;
	}

}
